(14, 4, 5, 4, 'Confidence boost, Strong foundation of both theoretical and practical knowledge', 'by doing more practical training, such as workshops and industry collaboration', 722, '2025-10-18 18:26:12', NULL),
(15, 4, 4, 4, '1) Strong basics of algorithm 2) critical thinking', '1) Industrial visits specially to IT companies need to be increased in order to showcase the students the reality of employment. Moreover, regular industrial visits will also make NDUB well-known to the reputable organizations.', 1002, '2025-10-18 18:26:25', NULL),
(16, 4, 4, 5, 'Developing consistency from academic culture, enhanced critical thinking and problem solving, strengthening of fundamental concept and practical training.', 'Integrating industry required soft skill learning environment, work best practices and more research based projects in individual courses (for publication).', 938, '2025-10-18 18:26:30', NULL),
(17, 5, 5, 5, 'The program included some courses such as machine learning, AI from which I got to learn various topics used in my job', 'The program could include new courses like cyber security, computer vision, NLP, SQA and introducing students with different coding platforms and github', 441, '2025-10-18 18:27:57', NULL),
(18, 3, 5, 3, 'It created the foundation of my growth in this sector.', 'Inclusion of Practical Oriented Courses, more projects of various development related topics like database, oop, clean architectures, api etc', 788, '2025-10-18 18:28:08', NULL),
(19, 4, 4, 4, '1) Strong basics of algorithm 2) critical thinking', '1) Industrial visits will ensure NDUB becomes well-known in the industry 2) skills like git-hub and resume formats must be taught to students to better prepare them for jobs', 1002, '2025-10-18 18:29:07', NULL),
(20, 4, 4, 4, 'This program helped me come to know of machine learning and gave me some very helpful professors and seniors.', 'The educational system can be helped by an upgrade.', 239, '2025-10-18 18:29:21', NULL),
(21, 4, 4, 4, 'It helps me to enlarge my knowledge and to face the real-time problem.', 'Evaluation system can be slightly modified and need more practice of codes.', 48, '2025-10-18 18:30:05', NULL),
